"use strict";(self.webpackChunkcigra_wiki=self.webpackChunkcigra_wiki||[]).push([[47514],{247514:a=>{a.exports=JSON.parse('{"brand":"Cohiba","brand_logo_image_list":[{"small":"/img/brandlogos/cohiba_632x400.jpg","large":"/img/brandlogos/cohiba.jpg"}],"status":"Cohiba is a current post-Revolution brand, established in 1966. It is classified by Habanos SA as their Global flagship brand, and has a major market share and is sold at a premium price.","generally":"The tobacco is the best available from the premium _Vuelta Abajo_ region. The Seco and Ligero filler leaf is given an exclusive third fermentation. The Classic and Maduro 5 lines comprise medium-to-full strength cigars, while the 1492 (Siglo) line comprise medium strength cigars, and the BHK line comprises full strength cigars.","standard":"Three cigars were commercially released in 1984. These cigars were termed as the the Classic Line (L\xednea Cl\xe1sica) in 1989. The L\xednea 1492 (Siglo) range was developed in 1992 and became commercially available in early 1994. The Maduro 5 range was released in 2007. The Behike range was released in 2010.","special":"Special releases commenced in 1996 with the release of the 30 Aniversario Humidor & Jar. Since then there have been numerous special releases.","brands":"/zh-Hans/brand/cohiba/bands","history":"In 1963 Cohiba started out as a Fuma (a cigar rolled by a torcedor for his own use) that was offered to Fidel Castro. It immediately became Fidel\'s favourite. In 1964, a small factory was set up to make these cigars. Production was later moved to the present El Laguito Factory. This original cigar was an unnamed Laguito No.1, and in 1967, two addition sizes were added....a Laguito No.2 and a Laguito No.3. The cigar brand remained unnamed until 1966, when it was officially named Cohiba. In 1969 the three cigars were given commercial names and the packaging and band designs finalised.","history_bands":[{"name":"Standard Band A","period":"1969 to early 1970s","status":"Discontinued","description":"Non-embossed paper","image":"/img/brandbands/cohiba-standard-band-a.jpg"},{"name":"Standard Band B","period":"Early 1970s to c1993","status":"Discontinued","description":"Non-embossed paper","image":"/img/brandbands/cohiba-standard-band-b.jpg"},{"name":"Standard Band C","period":"c1993 to 2003","status":"Discontinued","description":"Non-embossed paper","image":"/img/brandbands/cohiba-standard-band-c.jpg"},{"name":"Standard Band D","period":"2003 to c2014","status":"Discontinued","description":"Embossed","image":"/img/brandbands/cohiba-standard-band-d.jpg"},{"name":"Maduro band A","period":"2007 to 2016","status":"Discontinued","description":"Embossed","image":"/img/brandbands/cohiba-standard-band-e---maduro.jpg"},{"name":"Behike band A","period":"2010 to 2013","status":"","description":"Embossed. Incorporates two security holograms. Sometime in 2013 was replaced with a version with redesigned holograms.","image":"/img/brandbands/cohiba-standard-band-f---behike.jpg"},{"name":"Standard Band E","period":"2012 onwards","status":"","description":"Initially for the Piramides Extra, with other cigars starting mid-2014. Embossed, with hologram logo and strips top and bottom. A UV fluorescent code was added to the right wing of the band, along with a pattern of fluorescing squares, appearing sporadically since mid-2014. In 2023 the UV features began being removed from the bands.","image":"/img/brandbands/cohiba-standard-band-g.jpg"},{"name":"Maduro band B","period":"2016 onwards","status":"","description":"Embossed, with hologram logo and strips top and bottom. When exposed to UV light, a code appears below the A.","image":"/img/brandbands/cohiba-cohiba-standard-band-h---maduro.jpg"},{"name":"Behike band B","period":"2013 - Current","status":"","description":"Updated holograms with microprinting.","image":"/img/brandbands/cohiba-cohiba-behike-band-b1.jpg"}]}')}}]);